import './App.css';
import React, { Component } from 'react';
import Navbar from './Components/Navbar';
import News from './Components/News';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Routes>
            <Route
              path="/business"
              element={<News key="business" pageSize={9} country="pak" category="business" />}
            />
            <Route
              path="/entertainment"
              element={<News key="entertainment" pageSize={9} country="pak" category="entertainment" />}
            />
            <Route
              path="/general"
              element={<News key="general" pageSize={9} country="pak" category="general" />}
            />
            <Route
              path="/sports"
              element={<News key="sports" pageSize={9} country="pak" category="sports" />}
            />
            <Route
              path="/health"
              element={<News key="health" pageSize={9} country="pak" category="health" />}
            />
            <Route
              path="/science"
              element={<News key="science" pageSize={9} country="pak" category="science" />}
            />
            <Route
              path="/technology"
              element={<News key="technology" pageSize={9} country="pak" category="technology" />}
            />
          </Routes>
        </Router>
      </div>
    );
  }
}
